  false,\n\t\"url\": null,\n\t\"notes\": \"An orthoimage is remotely sensed image
  data in which displacement of features in the image caused by terrain relief and
  sensor orientation have been mathematically removed. Orthoimagery combines the image
  characteristics of a photograph with the geometric qualities of a map. For this
  dataset, the natural-color (RGB) orthoimages were produced at 1-ft (0.3-meter) pixel
  resolution. The design accuracy is estimated not to exceed 6.6 feet in X. The projected
  coordinate system is Florida State Plane (North), Zone 903 with a NAD83 datum. There
  is no image overlap been adjacent files.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
